import React from 'react';

const Hw = () => {
    return (
        <div className='mt-4'>
            <h1 className='display-5'>FInd Your <span className='text-danger'>Dream  Job</span> Here </h1>
            <p>Job hunting, job seeking, or job searching is the act of looking for employment, due to unemployment, underemployment, discontent with a current position, or a desire for a better position.Job hunting, job seeking, or job searching is the act of looking for employment, due to unemployment, underemployment, discontent with a current position, or a desire for a better position.</p>
        </div>
    );
};

export default Hw;
